// filepath: /c:/Users/venig/Documents/my-app/src/components/AboutUs.jsx
import React from 'react';
import '../styles/AboutUs.css';

const AboutUs = () => {
  return (
    <div className="about-us">
      <h1>About Us</h1>
      <p>
        What We Do
        <br />
        We offer a comprehensive online platform for learning Ayurveda. Our courses are designed to provide students with a solid foundation in Ayurvedic principles, practices, and therapies. With a focus on practical learning, we offer a range of courses that cater to different learning needs and levels of expertise. Our courses are designed and delivered by a team of experienced Ayurvedic practitioners, educators, and tech experts.
      </p>
      <p>
        Who We Are
        <br />
        We are a dedicated team of Ayurvedic experts, educators, and tech innovators committed to elevating Ayurvedic learning. Our mission is to equip students with in-depth knowledge, practical skills, and the confidence to thrive in their careers. By integrating AI into Ayurvedic education, we offer personalized learning paths and intelligent insights that cater to individual needs.
      </p>
    </div>
  );
};

export default AboutUs;
